import { useRouteLoaderData } from 'react-router-dom';
export async function loader() {
  const user = useRouteLoaderData('/admin');
  return fetch('http://localhost:8080/products')
    .then((response) => {
      return response.json();
    })
    .then((resData) => {
      return resData.products;
    })
    .catch((err) => {
      console.log(err);
    });
}
